const mergeObj=(baseObj,tagetObj)=>{
   const newObj= Object.keys(baseObj).reduce((pre,cur)=>{
      if(tagetObj[cur]){
        pre[cur]=tagetObj[cur]
      }else{
        pre[cur]=baseObj[cur]
      }
      return pre
    },tagetObj)
    return newObj
}


